import { Component, Input } from '@angular/core';
import { ImageService } from 'src/app/services/image.service';
import { WebRequestService } from 'src/app/services/web-request.service';


@Component({
  selector: 'app-image-upload',
  templateUrl: './image-upload.component.html',
  styleUrls: ['./image-upload.component.scss']
})
export class ImageUploadComponent {

  images: any;
  @Input() imagePaths: string[] = new Array();

  constructor(private imageService: ImageService, private webRequestService: WebRequestService) { }

  processFiles(event: any) {
    this.images = event.target.files;
    this.imageService.uploadImages(this.images).subscribe(
      (data) => {
        const arr: any = data;
        arr.forEach((image: any) => {
          const path = this.webRequestService.get(`uploads/images/${image.path}`);
          console.log(typeof path)
          this.imagePaths.push(image.path);
        });
      },
      (error) => {
        console.error(error);
      }
    )
  }


}
